import React from "react";

function List({ pokeData }) {
  <div>
    <h1>{pokeData}</h1>;
    <ul>
      {pokeData.map(pokemon => {
        return <li>{pokemon.name}</li>;
      })}
    </ul>
  </div>;
}

export default List;
